op zijn Indian motor en wijdt zijn leven aan het perfectioneren van zijn klassieke motor. Niets of niemand kan Burt Munro ervan 
weerhouden om zijn dromen te verwezenlijken. Hij vertrekt naar de Bonneville zoutvlaktes in Utah voor de ultieme test van zijn 
Indian tijdens de Speed Week.:
